import React from 'react';
import {ListItem} from './list_items';
import './navbar.css';
import logo from '../../../../logoo1.png';



function Scrolling(){
  return(
    $(document).ready(function(){
      $(window).scroll(function(){
        var element = document.getElementById("mobile");
        var scroll = $(window).scrollTop();
        if (scroll > 120) {
          element.classList.add("fixed-top");
          $("#mobile").css("background" , "rgba(26,26,26,0.9)");
        }
        else{
          $("#mobile").css("background" , "none");
          element.classList.remove("fixed-top");
        }
      })
    })
  )
}


class Navbar extends React.Component{
  state ={clicked:false}

  handleClick = ()=>{
    this.setState({ clicked: !this.state.clicked})
  }
  render(){
    return(
      <nav className="NavbarItems" id="mobile">
      <div>
        <img className="logoimg" src={logo} alt="logo"/>
      </div>
        <div className="menu-icon" onClick={this.handleClick}>
          <i className={this.state.clicked? 'fas fa-times':
          'fas fa-bars'}></i>
        </div>
        <ul className={this.state.clicked ?'nav-menu active':
        'nav-menu'}>
        {ListItem.map((item,index) => {
          return(
            <li key={index}>
              <a className={item.cName} href={item.url}>
              {item.name}
              </a>
            </li>
          )
        })}
        </ul>
      </nav>
    )
  }
}

export default Navbar
